Who Needs Ibiza? The Great British Holiday

Travel Documentary hosted by Charlie Baker, published by BBC in 2014 - English narration


Information
------------------------------

Who Needs Ibiza? The Great British Holiday
Series following the efforts of the owners and staff at an 18-30s campsite in Devon England, as they try to overcome a string of wet, recession-hit summers and make 2013 a roaring success.


1)  Part 1 
It's the start of high season at Europa and the team are coming up with some novel ideas to make some much needed cash and entertain the campers. A Disney tribute band has been booked and a Hawaiian theme night planned, but big storms are brewing on the horizon - both amongst the staff and in the skies above the campsite.

2)  Part 2 
After being hit by one of the worst storms in decades, the Europa campsite is suffering a worrying mid-season slump. To make matters worse, key managers Joey and Vicki have fallen out. With the all-important bumper bank holiday weekend approaching, it's critical that the team pull together and bring in the cash. They need a record-breaking theme night that's literally out of this world.

